        <h1>Назначение МЧС Республики Беларусь</h1>
        <h2>
            Министерство по чрезвычайным ситуациям Республики Беларусь (МЧС) является республиканским органом
            государственного управления, осуществляющим регулирование и управление в сфере предупреждения и ликвидации
            чрезвычайных ситуаций природного и техногенного характера и гражданской обороны, обеспечения пожарной,
            промышленной, ядерной и радиационной безопасности, ликвидации последствий катастрофы на Чернобыльской АЭС,
