        <h1>Назначение МВД Республики Беларусь</h1>
        <h2>
            Органы внутренних дел – это государственные правоохранительные органы, осуществляющие борьбу с преступностью,
            охрану общественного порядка и обеспечивающие общественную безопасность в соответствии с задачами, возложенными
            на них законодательными актами Республики Беларусь.
            Органы внутренних дел являются составной частью системы обеспечения национальной безопасности Республики
            Беларусь.
        </h2>
        <h3 class=""text-center"">
            Основными задачами органов внутренних дел и как ее составляющей – милиции, согласно статье 2
            Закона Республики Беларусь, являются:
        </h3>

        <ul class=""about-mhs-list"">
            <li>
                <h4>
                    защита жизни, здоровья, чести, достоинства, прав, свобод и законных интересов граждан Республики
                    Беларусь, иностранных граждан и лиц без гражданства от преступн");
            WriteLiteral(@"ых и иных противоправных посягательств,
                    обеспечение их личной и имущественной безопасности, защита прав и законных интересов организаций от
                    преступных и иных противоправных посягательств в соответствии с компетенцией органов внутренних дел;
                </h4>
            </li>
            <li>
                <h4>
                    защита интересов общества и государства от преступных и иных противоправных посягательств, охрана
                    общественного порядка и обеспечение общественной безопасности;
                </h4>
            </li>
            <li>
                <h4>защита собственности от преступных и иных противоправных посягательств;</h4>
            </li>
            <li>
                <h4>
                    профилактика, выявление, пресечение преступлений и административных правонарушений, производство
                    дознания по уголовным делам, ведение административного процесса в соответствии с их компетенцией;
 ");
            WriteLiteral(@"               </h4>
            </li>
            <li>
                <h4>
                    розыск обвиняемых, местонахождение которых неизвестно, лиц, скрывающихся от органов, ведущих уголовный
                    процесс, лиц, уклоняющихся от отбывания наказания или иных мер уголовной ответственности, без вести
