        <h1>Служба скорой медицинской помощи (далее - СМП)</h1>
        <h2>
            Работает круглосуточно, обеспечивая неотложную помощь взрослому и детскому населению, как на месте происшествия,
            так и в пути следования в стационар при состояниях, угрожающих здоровью или жизни, вызванных внезапными
            заболеваниями, несчастными случаями, отравлениями и травмами требующих экстренного или неотложного медицинское
            вмешательство.
        </h2>
        <h3 class=""text-center"">В задачи скорой медицинской помощи входит:</h3>
        <ul class=""about-mhs-list"">
            <li>
                <h4>
                    защита жизни, здоровья, чести, достоинства, прав, свобод и законных интересов граждан Республики
                    Беларусь, иностранных граждан и лиц без гражданства от преступных и иных противоправных посягательств,
                    обеспечение их личной и имущественной безопасности, защита прав и законных интересов организаций от
            ");
            WriteLiteral(@"        преступных и иных противоправных посягательств в соответствии с компетенцией органов внутренних дел;
                </h4>
            </li>
            <li>
                <h4>транспортировка пациентов в стационарные учреждения здравоохранения.</h4>
            </li>
            <li>
                <h4>
                    участие в ликвидации медицинских последствий чрезвычайных происшествий, аварий, катастроф и стихийных
                    бедствий.
                </h4>
            </li>
        </ul>
        <h3>В режиме повышенной готовности служба скорой медицинской помощи работает для:</h3>
        <ul class=""about-mhs-list"">
            <li>
                <h4>обеспечения массовых мероприятий;</h4>
            </li>
            <li>
                <h4>возможных чрезвычайных ситуаций.</h4>
            </li>
        </ul>
        <h2>
            При этом служба СМП обеспечивает взаимодействия бригад: между собой и с территориальными органами управления
            ");
            WriteLiteral(@"здравоохранения, государственными организациями здравоохранения; с оперативно-дежурными службами органов
            внутренних дел Республики Беларусь и Министерства по чрезвычайным ситуациям Республики Беларусь.
        </h2>
        <h3>В чрезвычайном режиме служба скорой медицинской помощи осуществляет:</h3>
        <ul class=""about-mhs-list"">
            <li>
                <h4>оповещение о чрезвычайной ситуации органов здравоохранении;</h4>
            </li>
            <li>
                <h4>направление к границе зоны чрезвычайной ситуации бригад СМП;</h4>
            </li>
            <li>
                <h4>проведение лечебно-эвакуационных мероприятий пострадавшим. </h4>
            </li>
        </ul>
        <h2>
            Вызовы, поступающие на станцию скорой медицинской помощи по единому номеру 103 либо по другому номеру телефона,
